import React from 'react';
import axios from 'axios';
class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [{
                title: ""
            }]
        }
    }

    componentDidMount() {
        this.getData()
    }

    getData = () => {
        axios.get("http://localhost:8081/admin/products").then((res) => {
            this.setState({ data: res.data.data });
        }).catch((error) => {
            console.log(error);
        });
    }

    handleDelete = (product_id) => {
        console.log(product_id);
        axios.get('http://localhost:8081/admin/delete-products?product_id=' + product_id).then(res => {
            console.log(res.data);
            if (res.data.result) {
                this.getData();
            }
        }).catch(error => {
            console.log(error);
        });
    }
    render() {
        return (
            <div>
                <div className="brand">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-12">
                                <div className="titlepage">
                                    <h2>Our Car</h2>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="brand-bg">
                        <div className="container">
                            <div className="row">

                                <div className="col-xl-4 col-lg-4 col-md-4 col-sm-6 margin">
                                    <div className="brand_box">
                                        <img src="assets/images/1.png" alt="img" />
                                        <h3>$<strong className="red">100</strong></h3>
                                        <span>Mobile Phone</span>
                                        <i><img src="assets/images/star.png" /></i>
                                        <i><img src="assets/images/star.png" /></i>
                                        <i><img src="assets/images/star.png" /></i>
                                        <i><img src="assets/images/star.png" /></i>
                                    </div>
                                </div>
                                
                                <div className="col-md-12">
                                    <a className="read-more">See More</a>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

        )
    }
}

export default Home;
